import "./DisplayPanel.css";

const DisplayPanel: React.FC<DisplayPanelProps> = (props) => (
  <div id="display" className="display-panel">
    {props.results?.map((x) => (
      <div key={x} className="display-panel-result">{x}</div>
    ))}
    <div className="display-panel-input">{props.input}</div>
  </div>
);

interface DisplayPanelProps {
  input?: string;
  results?: string[];
}

DisplayPanel.defaultProps = {
  input: "12334-12312",
  results: [""],
};

export default DisplayPanel;
